webpackJsonp([0x1aabc0bc93a02200],{"./node_modules/json-loader/index.js!./.cache/json/javascript-arithmetic-operation.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p>JavaScript provides the user with five arithmetic operators: <code>+</code>, <code>-</code>, <code>*</code>, <code>/</code> and <code>%</code>. The operators are for addition, subtraction, multiplication, division and remainder respectively.</p>\n<h2>Addition</h2>\n<p><strong>Syntax</strong></p>\n<p><code>a + b</code></p>\n<p><strong>Usage</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>2 + 3          // returns 5\ntrue + 2       // interprets true as 1 and returns 3\nfalse + 5      // interprets false as 0 and returns 5\ntrue + "bar"   // concatenates the boolean value and returns "truebar"\n5 + "foo"      // concatenates the string and the number and returns "5foo"\n"foo" + "bar"  // concatenates the strings and returns "foobar"</code></pre>\n      </div>\n<p><em>Hint:</em> There is a handy <a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators#Increment_(\' target=\'_blank\' rel=\'nofollow\'>increment</a>) operator that is a great shortcut when you’re adding numbers by 1.</p>\n<h2>Subtraction</h2>\n<p><strong>Syntax</strong></p>\n<p><code>a - b</code></p>\n<p><strong>Usage</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>2 - 3      // returns -1\n3 - 2      // returns 1\nfalse - 5  // interprets false as 0 and returns -5\ntrue + 3   // interprets true as 1 and returns 4\n5 + "foo"  // returns NaN (Not a Number)</code></pre>\n      </div>\n<p><em>Hint:</em> There is a handy <a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators#Decrement_(--\' target=\'_blank\' rel=\'nofollow\'>decrement</a>) operator that is a great shortcut when you’re subtracting numbers by 1.</p>\n<h2>Multiplication</h2>\n<p><strong>Syntax</strong></p>\n<p><code>a * b</code></p>\n<p><strong>Usage</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>2 * 3                // returns 6\n3 * -2               // returns -6\nfalse * 5            // interprets false as 0 and returns 0\ntrue * 3             // interprets true as 1 and returns 3\n5 * "foo"            // returns NaN (Not a Number)\nInfinity * 0         // returns NaN\nInfinity * Infinity  // returns Infinity</code></pre>\n      </div>\n<h2>Division</h2>\n<p><strong>Syntax</strong></p>\n<p><code>a / b</code></p>\n<p><strong>Usage</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>3 / 2                // returns 1.5\n3.0 / 2/0            // returns 1.5\n3 / 0                // returns Infinity\n3.0 / 0.0            // returns Infinity\n-3 / 0               // returns -Infinity\nfalse / 5            // interprets false as 0 and returns 0\ntrue / 2             // interprets true a 1 and returns 0.5\n5 + "foo"            // returns NaN (Not a Number)\nInfinity / Infinity  // returns NaN</code></pre>\n      </div>\n<h2>Remainder</h2>\n<p><strong>Syntax</strong></p>\n<p><code>a % b</code></p>\n<p><strong>Usage</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>3 % 2          // returns 1\ntrue % 5       // interprets true as 1 and returns 1\nfalse % 4      // interprets false as 0 and returns 0\n3 % "bar"      // returns NaN</code></pre>\n      </div>\n<p><em>!Important!</em> As you can see, you <strong>cannot</strong> perform any sort of operations on <code>Infinity</code>.</p>\n<p>Source: The amazing <a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators\' target=\'_blank\' rel=\'nofollow\'>MDN</a>.</p>',fields:{slug:"/javascript/arithmetic-operation/"},frontmatter:{title:"Arithmetic Operation"}}},pathContext:{slug:"/javascript/arithmetic-operation/"}}}});
